import './App.css'
import Cardsheet from './component/Cardsheet'

showall = ()=>{
  <Cardsheet/>
}

export default class App extends Component {
  render (){
    return(
      <div class="card_bg">
        <div class="main_btn">
          <button class="btn" onClick={showall}>All Hotel's</button>
          <button class="btn">Hotel above 1*</button>
          <button class="btn">Hotel above 2*</button>
          <button class="btn">Hotel above 3*</button>
          <button class="btn">Hotel above 4*</button>
        </div>

      </div>
    )
  }
}
